import React, {useState} from 'react';
import './AttributeLayout.css';

const AttributeLayout = () => {
    const [selectedOptions, setSelectedOptions] = useState({
        designs: '',
        products: '',
        materials: '',
        colors: '',
        prices: ''
    });

    // Function to handle selection of an option in a section
    const handleOptionSelection = (section, option) => {
        setSelectedOptions(prevOptions => ({
            ...prevOptions,
            [section]: option
        }));
    };
    // <li>Gray</li>
    // <li>White</li>
    // <li>Cream</li>
    // <li>Charcoal</li>
    // <li>Teal</li>
    // <li>Beige</li>
    // <li>Silver</li>
    // <li>NavyBlue</li>
    // <li>OliveGreen</li>
    // <li>Lavender</li>
    // <li>Coral</li>
    // <li>CarrotOrange</li>
    // <li>CrimsonRed</li>

    return (
        <div className="attribute-layout">
            <div className="section">
                <h3>Designs</h3>
                <ul>
                    <li><button onClick={() => handleOptionSelection('designs', 'Low Top')}>Low Top</button></li>
                    <li><button onClick={() => handleOptionSelection('designs', 'High Top')}>High Top</button></li>
                    <li><button onClick={() => handleOptionSelection('designs', 'Slip-on')}>Slip-on</button></li>
                    <li><button onClick={() => handleOptionSelection('designs', 'Mid Top')}>Mid Top</button></li>
                    <li><button onClick={() => handleOptionSelection('designs', 'Mule')}>Mule</button></li>
                </ul>
            </div>
            <div className="section">
                <h3>Products</h3>
                <ul>
                    <li><button onClick={() => handleOptionSelection('products', 'Basas')}>Basas</button></li>
                    <li><button onClick={() => handleOptionSelection('products', 'Vintas')}>Vintas</button></li>
                    <li><button onClick={() => handleOptionSelection('products', 'Urbas')}>Urbas</button></li>
                    <li><button onClick={() => handleOptionSelection('products', 'Pattas')}>Pattas</button></li>
                    <li><button onClick={() => handleOptionSelection('products', 'Socks')}>Socks</button></li>
                    <li><button onClick={() => handleOptionSelection('products', 'Shoelaces')}>Shoelaces</button></li>
                </ul>
            </div>
            <div className="section">
                <h3>Material</h3>
                <ul>
                    <li><button onClick={() => handleOptionSelection('materials', 'Canvas')}>Canvas</button></li>
                    <li><button onClick={() => handleOptionSelection('materials', 'Suede')}>Suede</button></li>
                    <li><button onClick={() => handleOptionSelection('materials', 'Leather')}>Leather</button></li>
                    <li><button onClick={() => handleOptionSelection('materials', 'Flannel')}>Flannel</button></li>
                    <li><button onClick={() => handleOptionSelection('materials', 'Corduroy')}>Corduroy</button></li>
                </ul>
            </div>
            <div className="section">
                <h3>Color</h3>
                <ul>
                    <li><button onClick={() => handleOptionSelection('colors', 'Gray')}>Gray</button></li>
                    <li><button onClick={() => handleOptionSelection('colors', 'White')}>White</button></li>
                    <li><button onClick={() => handleOptionSelection('colors', 'Cream')}>Cream</button></li>
                    <li><button onClick={() => handleOptionSelection('colors', 'Charcoal')}>Charcoal</button></li>
                    <li><button onClick={() => handleOptionSelection('colors', 'Teal')}>Teal</button></li>
                    {/* Add other color options */}
                </ul>
            </div>
            <div className="section">
                <h3>Price</h3>
                <ul>
                    <li><button onClick={() => handleOptionSelection('prices', 'Under 200')}>Under 200</button></li>
                    <li><button onClick={() => handleOptionSelection('prices', '200 - 299')}>200 - 299</button></li>
                    <li><button onClick={() => handleOptionSelection('prices', '300 - 399')}>300 - 399</button></li>
                    <li><button onClick={() => handleOptionSelection('prices', '400 - 499')}>400 - 499</button></li>
                    <li><button onClick={() => handleOptionSelection('prices', '500 - 599')}>500 - 599</button></li>
                    <li><button onClick={() => handleOptionSelection('prices', '> 600')}>600+</button></li>
                </ul>
            </div>
        </div>
    );

};

export default AttributeLayout;
